import React, { useState } from 'react';
import '../styles/ControlPanel.css';

const ControlPanel = ({ onFilterChange, onSelectStart, onSelectEnd }) => {
    const [selectedFilter, setSelectedFilter] = useState('');
    const [startInput, setStartInput] = useState('');
    const [endInput, setEndInput] = useState('');

    const handleFilterChange = (level) => {
        setSelectedFilter(level);
        onFilterChange(level);
    };

    const handleStartChange = (e) => {
        setStartInput(e.target.value);
    };

    const handleEndChange = (e) => {
        setEndInput(e.target.value);
    };

    const handleStartSelect = () => {
        onSelectStart(startInput);
    };

    const handleEndSelect = () => {
        onSelectEnd(endInput);
    };

    return (
        <div className="control-panel">
            <h2>Control Panel</h2>
            <div className="filter-buttons">
                <button onClick={() => handleFilterChange('High')}>High</button>
                <button onClick={() => handleFilterChange('Moderate')}>Moderate</button>
                <button onClick={() => handleFilterChange('Low')}>Low</button>
            </div>
            
            <h3>Enter Start and End Locations</h3>
            <input
                type="text"
                placeholder="Enter start location"
                value={startInput}
                onChange={handleStartChange}
            />
            <button onClick={handleStartSelect}>Set Start</button>
            <input
                type="text"
                placeholder="Enter end location"
                value={endInput}
                onChange={handleEndChange}
            />
            <button onClick={handleEndSelect}>Set End</button>
        </div>
    );
};

export default ControlPanel;
